// src/components/ui/dialog.jsx

import React from "react";

export function Dialog({ open, onClose, children }) {
  if (!open) return null;
  return (
    <div className="fixed inset-0 flex items-center justify-center z-50 bg-black/40">
      <div className="bg-white rounded-lg shadow-lg min-w-[340px] max-w-[90vw] p-6 relative">
        <button
          className="absolute top-3 right-3 text-gray-500 hover:text-red-500 text-xl"
          onClick={onClose}
        >
          &times;
        </button>
        {children}
      </div>
    </div>
  );
}

// Example for content/header/footer wrappers (optional for your pattern):
export const DialogContent = ({ children }) => <div>{children}</div>;
export const DialogHeader = ({ children }) => (
  <div className="mb-4">{children}</div>
);
export const DialogTitle = ({ children }) => (
  <h2 className="text-2xl font-bold mb-2 text-athletiq-navy">{children}</h2>
);
export const DialogFooter = ({ children }) => (
  <div className="mt-6 flex justify-end gap-2">{children}</div>
);
